    constructor(props) {
        super(props);
        this.state = {

                title: "response.data.title",
                des: "response.data.data.titledes",
                auth:  "response.data.data.auth",
                readtimes: "response.data.data.readtimes"

        }
      }

      componentDidMount() {
        this.fetch();
      }

      fetch() {

        var { url } = this.props;


        axios.get(url)
          .then((response) => {
        //   if(baseUrl == "https://api.unsplash.com/search/photos/")
        {
            this.setState({
              title: response.data.data.title,
              des:  response.data.data.titledes,
              auth:  response.data.data.auth,         
              readtimes: response.data.data.readtimes             
            });
          }    

          })
          .catch(() => {
            alert("exception in proceess")
          });
      }


      render() {
        return(
    <div className="container2">
            <div className="para">
                <div className="mainb">
                    <h1>{this.state.title}</h1>
                </div>
                <div className="b1">
                    <p>{this.state.des}</p>
                </div>
                <div className="auth">
                    <p>{this.state.auth}</p>
                </div>
                <div className="new">
                <div className="pub">
                    <p> Apr {this.state.readtimes} min read &#9733;</p>
                </div>
                <div className="resp">
                    {/* <i className="fa fa-bookmark-o"></i>  */}
                    <i class="material-icons">&#xe866;</i>
                </div>
                </div>
            </div> <br/>
   </div>
        );
    }

   }

export default HomeComponent;
